import React from 'react';
import './Profile.css';
import profile from '../ImagesLogo/profile.jpg';

function Profile() {
    return (
        <div className='profile'>
            <img src={profile} alt=''/>
            <span> Hi, I'm Harish ,</span>
            <h1> Junior Front-End Developer</h1>
            <p>I am a passionate front-end developer with a strong enthusiasm for building engaging and acessible web application.With a solid understanding of core web technologies like HTML,CSS, and JavaScript,I have completed several projects that highlight my skills in responsive design and user interface development. </p>
            <div className="profile-action">
                <div className="profile-connect">Connect with me</div>
                <div className="profile-resume">My Resume</div>
            </div>
        </div>
    )
}

export default Profile
